import { LOG_IN,LOG_OUT } from "../Constant/Constant"

const initstage = { 
    // eslint-disable-next-line no-undef
    token: false,
}


const LogInuser = (state=initstage,action)=>{
    switch(action.type){
        case LOG_IN:{
            console.log('-------------',state)
            return{
                token: action.payload.token
            }
        }
        case LOG_OUT:{
            return{
                token:false
            }
        }
        default:
            return state
    }
}

export  default LogInuser
